import { Typography, Card, CardMedia, CardContent, CardActions, Button } from '@material-ui/core';


import useStyles from './styles'


function Map({ centre, setCentre, places }) {
  const classes = useStyles();

  const defaultProps = {
    centre: {
      lat: 0,
      lng: 0
    },
    zoom: 12
  }
  // console.log(places)

  //TODO: Add key to ENV file

  return (
    <div className={classes.container}>
      <GoogleMapReact
        bootstrapURLKeys={{ key: 'AIzaSyD2puGPtJBCXGtB1QgL7Fhh_VMALg_InmY' }}
        defaultCenter={defaultProps.centre}
        defaultZoom={defaultProps.zoom}
        center={defaultProps.centre}
        onChange={(event) => {
          // console.log(event);

        }}
      >
        <div  lat={0} lng={0}>

            <Card sx={{ maxWidth: 345 }}>
      <CardMedia
        sx={{ height: 140 }}
        image="/static/images/cards/contemplative-reptile.jpg"
        title="green iguana"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Lizard
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
        </div>
      </GoogleMapReact>

    </div>

      // <h1 className={classes.container}>
      //   Hello, Map!
      // </h1>
  )
}

export default Map;
